  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a study done to
  assess selenium levels on Benton Lake NWR. Because selenium is not evenly distributed
  across wetland units, sampling in 2006 focused on areas with the highest and lowest
  historic levels of contamination to define the range of hazard values. Selenium
  levels were measured at 4 trophic levels (water, sediment, invertebrates and eggs)
  according to the Lemly protocol. Results are provided for each unit that was sampled.\",\n\t\"license_title\":
